<React.Fragment>

<h1>List of top five Netflix Series </h1>
<Card
 imgsrc={Array_obj[0].imgsrc}
  title={Array_obj[0].title}
  link={Array_obj[0]. link}
  name={Array_obj[0]. name}

/>


<Card />
<Card />

</React.Fragment>,
document.getElementById("root")
